    useEffect(() => {
     axios
     .get("http://localhost:3000/auth/login/success")
    }, [])

    return(
        <div>
        <div className="NavHead">
            <div className="AppName">My App</div>
            <div className="Menu">
                <div>Login</div>
                <div>Sayoni</div>
                <div>Logout</div>
            </div>

        </div>
        {children}
        </div>
    )
}
export default Navbar;
